    xaxis=XAxis(
        autorange='reversed'
    )
)
fig = Figure(data=data, layout=layout)

if not fig:
    if not data:
        raise Exception('no data OR figure!!')
    fig = dict(data=data)  # assumes fig or data
if 'layout' not in fig:
    fig['layout'] = dict()
if 'margin' not in fig['layout']:
