  showlegend: false, 
  annotations: [
    {
      x: 2, 
      y: 5, 
      text: "Annotation Text", 
      xref: "x", 
      yref: "y", 
      showarrow: true, 
      arrowhead: 7, 
      ay: -40, 
      ax: 0
    }, 
    {
      x: 4, 
      y: 4, 
      text: "Annotation Text 2", 
      xref: "x", 
      yref: "y", 
      showarrow: true, 
      arrowhead: 7, 
      ay: -40, 
      ax: 0
