var linspace = require('linspace');

var t = linspace(-1,1.2,2000);
var x = (Math.pow(t, 3)) + (0.3 * (Math.random() * 2000));
var y = (Math.pow(t, 6)) + (0.3 * (Math.random() * 2000));
var trace1 = {
  x: x, 
  y: y, 
  name: "points", 
  mode: "markers", 
  marker: {
    size: 2, 
    color: "rgb(102,0,0)", 
    opacity: 0.4
  }, 
  type: "scatter"
};
var trace2 = {
  x: x, 
  y: y, 
  name: "density", 
  ncontours: 20, 
  scl: "Hot", 
  reversescl: true, 
  showscale: false, 
  type: "histogram2dcontour"
};
var trace3 = {
  x: x, 
  name: "x density", 
  marker: {color: "rgb(102,0,0)"}, 
  yaxis: "y2", 
  type: "histogram"
};
var trace4 = {
